      e.preventDefault();
      const filter = {
        distance: document.getElementById('distance').value,
        name: document.getElementById('name').value,
        size: document.getElementById('size').value,
        season: document.getElementById('season').value
      };
      console.log(filter);
      await getRaces(filter);
    });
  });
